import './HistoryListItem.css';

const HistoryListItem = ({el}) => {
  return (
    <div className='History_item'>
      <p className='history_item_name'>{el.date}</p>
      <p className='history_item_name'>{el.summ}</p>
      <p className='history_item_name'>категорія</p>
      <p className='history_item_name'>опис</p>
    </div>
  );
};

function mapStateToProps (state) {
  return {

    historyArr: state.HistoryArr,
  }
}

HistoryListItem.propTypes = {

};

export default connect (mapStateToProps) (HistoryListItem);
